import * as React from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';

export default function DisabledOptions() {
  return (
    <>
    <Autocomplete
      id="disabled-options-demo"
      options={timeSlots}
      sx={{ width: 125 }}
      renderInput={(params) => <TextField {...params} label="Inicio" />}
    />
    <Autocomplete
      id="disabled-options-demo"
      options={timeSlots}
      sx={{ width: 125 }}
      renderInput={(params) => <TextField {...params} label="Final" />}
    />
    <Autocomplete
      disablePortal
      id="combo-box-demo"
      options={weeksDays}
      sx={{ width: 300 }}
      renderInput={(params) => <TextField {...params} label="Movie" />}
    />
    </>
  );
}

// One time slot every hour.
const timeSlots = Array.from(new Array(24)).map(
  (_, index) =>
    `${index < 10 ? '0' : ''}${Math.floor(index)}:${'00'}`,
);

// Week's days
const weeksDays = [
  { label: 'Lunes', year: 1994 },
  { label: 'Martes', year: 1972 },
  { label: 'Miercoles', year: 1974 },
  { label: 'Jueves', year: 2008 },
  { label: 'Viernes', year: 1957 },
